function useStats(){
    const[stats, setStats] = useState();
    useEffect(() => {
        async function fetchData() {
            console.log("Fetching Data");
            const data = await fetch('https://covid19.mathdro.id/api').then
                (res => res.json()
                );
                setStats(data);
        }

        fetchData();
    }, []);
    return stats;
}

function Stats(){
    const stats = useStats();
    console.log(stats);
    return <div>

        <p>STats: </p>
    </div>
}

